import logo from "./logo.svg";
import "./App.css";
import { Button, Typography, Layout, Menu, Icon } from "antd";
import React, { Component } from "react";

import ProfilePic from "./raghu.jpg";
const { Title } = Typography;
const { Header, Content, Footer, Sider } = Layout;

class App extends Component {
  handleItemClick = (e, { name }) => this.setState({ activeItem: name });

  render() {
    return (
      <div className="" style={{ height: "100%" }}>
        <Layout
          style={{
            overflow: "auto",
            height: "100vh",
            left: 0,
            position: "fixed"
          }}
        >
          <Header>Header</Header>
          <Content className="background-image App App-header">
            <img
              src={ProfilePic}
              height="300px"
              style={{ borderRadius: "10%", boxShadow: "2px 2px 40px black" }}
            />
            <br />
            <Title style={{ color: "white" }}>Shri Raghu Raaman</Title>
            <Title level={4} style={{ color: "white" }}>
              Blockchain Trainer, Developer and Architect | Co-Founder & CEO at
              CelebratON | Web Developer | Hustler
            </Title>
            <Title level={4} style={{ color: "black" }}>
              Blockchain Trainer, Developer and Architect | Co-Founder & CEO at
              CelebratON | Web Developer | Hustler
            </Title>
          </Content>

          <Footer>Footer</Footer>
        </Layout>
      </div>
    );
  }
}

export default App;
